description:
Ben 10: Alien Swarm (2009)  

Verenigde Staten
Science-Fiction
90 minuten

geregisseerd door Alex Winter
met Barry Corbin, Ryan Kelley en Galadriel Stineman

Ben is een jongen met speciale krachten. Op een dag wordt hij benaderd door een mysterieuze vrouw genaamd Elena. Ze wil dat hij haar helpt een buitenaardse bedreiging te ontmaskeren.Ben besluit met zijn vrienden die ook superkrachten hebben de vrouw te helpen.

